import { Component } from "react";
import React from "react";

class Skill extends Component{
    constructor(props){
        super(props)
        this.state = {
            'mylang':["JS","JAVA","C++","PYTHON","RUBY"],
            'mynolang':["HTML","CSS","SQL","NOSQL","XML","RDF","OWL"],
            'technology':["NODE.JS","REACT","FIREBASE","MYSQL","MOGODB"],
            'other':["ONTOLOGY ENGINEER","ER DIAGRAM DESING","RAPIDMINER","SIMMAN","MICROCONTROLLER","FUNDUMANTAL OF STATISTICS"]
        }
    }
    render(){
        return(
            <div className="Education-card">
                <h1 className="Related-knowledge">Related knowledge</h1>
                <ul>
                    {this.state.mylang.map((val)=>{
                        return(<li>{val}</li>)
                    })}
                </ul>
                <ul>
                    {this.state.mynolang.map((val) =>{
                        return(<li>{val}</li>)
                    })}
                </ul>
            </div>
        )
    }
}
export default Skill;
